import { Fragment } from "react";
import { classNames } from "../App";
import { Lecture, lectures } from "../SITE_DATA";

type LectureTableProps = {
  lectures: {
    name: string;
    date: string; // Jan 28
    description?: string; // Short 1-2 sentence lecture description, optional
    notesLink?: string;
    recordingLink?: string;
    liveCodeLink?: string;
    // Arbitrary links with arbitrary names:
    otherLinks?: { name: string; link: string }[]; // NOTE: Nothing preventing name conflict between notes/recording/livecode name
  }[];
};

export default function LecturesTable(props: LectureTableProps) {
  return (
    <div className="mt-8 flex flex-col">
      <div className="-my-2 -mx-4 overflow-x-auto sm:-mx-6 lg:-mx-8">
        <div className="inline-block min-w-full py-2 align-middle md:px-6 lg:px-8">
          <div className="overflow-hidden shadow ring-1 ring-black ring-opacity-5 md:rounded-lg">
            <table className="min-w-full divide-y divide-gray-300">
              <thead className="bg-gray-50">
                <tr>
                  <th
                    scope="col"
                    className="py-3.5 pl-4 pr-3 text-center text-sm font-semibold text-gray-900 sm:pl-6"
                  >
                    Name
                  </th>
                  <th
                    scope="col"
                    className="px-3 py-3.5 text-center text-sm font-semibold text-gray-900"
                  >
                    Date
                  </th>
                  <th
                    scope="col"
                    className="px-3 py-3.5 text-center text-sm font-semibold text-gray-900"
                  >
                    Notes
                  </th>
                  <th
                    scope="col"
                    className="px-3 py-3.5 text-center text-sm font-semibold text-gray-900"
                  >
                    Recording
                  </th>
                  <th
                    scope="col"
                    className="px-3 py-3.5 text-center text-sm font-semibold text-gray-900"
                  >
                    Live Code
                  </th>
                </tr>
              </thead>
              <tbody className="divide-y divide-gray-200 bg-white">
                {props.lectures.map((lecture) => (
                  <tr key={lecture.name}>
                    <td>
                      {lecture.name}
                    </td>
                    <td>
                      {lecture.date}
                    </td>
                    {lecture.notesLink ? (
                      <td>
                        <a href={lecture.notesLink}>Notes</a>
                      </td>
                    ) : (
                      <td>-</td>                
                    )}  
                    {lecture.recordingLink ? (
                      <td>
                        <a href={lecture.recordingLink}>Recording</a>
                      </td>
                    ) : (
                      <td>-</td>                
                    )}  
                    {lecture.liveCodeLink ? (
                      <td>
                        <a href={lecture.liveCodeLink}>Live Code</a>
                      </td>
                    ) : (
                      <td>-</td>                
                    )}  
                    {lecture.otherLinks ? (
                      <td>
                        otherLinks
                      </td>
                    ) : (
                      <td>-</td>                
                    )}
                    {/* {assignment.href && shouldRelease(assignment) ? (
                      <td>
                        <a
                          href={assignment.href}
                          className="whitespace-nowrap py-4 pl-4 pr-3 text-sm font-bold underline text-primary-500 sm:pl-6"
                        >
                          {assignment.name}
                        </a>
                      </td>
                    ) : (
                      <td className="whitespace-nowrap py-4 pl-4 pr-3 text-sm font-medium text-gray-400 sm:pl-6">
                        {assignment.name}
                      </td>
                    )}

                    <td className="whitespace-nowrap px-3 py-4 text-sm text-gray-500">
                      {assignment.dateRange}
                    </td> */}
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </div>
  );


}

